import React from "react";
import '../css/TaskForm.css';

function TaskForm(props) {
    return (
        <form className="TaskForm">
            <input 
            className="Taskinput"
            type="text"
            placeholder="Escribe una Tarea"
            name='texto'
            />
            <button className="TaskButton"> Agregar Tarea</button>
        </form>
    );
}
export default TaskForm ;
